import React from 'react'
import props from 'prop-types'
import { Box, Card, Image, Heading, Text, Link } from 'rebass'
import bunkerDownImage from '../images/600x900BunkerDown.png'
import dInfinityImage from '../images/MortyArchmage.png'

var projects = {"Bunker Down": {"type":"Video Game", "image":bunkerDownImage, "Link":null},
                "DInfinity": {"type":"Video Game", "image":dInfinityImage, "Link":null},
                "Resume": {"type": "Master Resume", "image":dInfinityImage, "Link":null}
              }
var cards = []

const ProjectCards = () => {
  for (var project in projects) {
    cards.push(getProjectCard(project))
  }
  return (cards)
}

function getProjectCard(project) {
  return (
    <Link href='https://rebassjs.org' mx='auto'>
    <Box width={256}>
      <Card mx='auto'
        sx={{
          alignItems: 'center',
          p: 1,
          borderRadius: 5,
          boxShadow: '0 0 16px rgba(0, 0, 0, .25)'
        }}>
          <Image src={projects[project]["image"]}
                 sx={{height:"300px", display: "block", margin: "auto"}}
                 />
        <Box px={2}>
          <Heading as='h3' textAlign='center' sx={{fontFamily:"Arial"}}>
            {project}
          </Heading>
          <Text fontSize={0}
          sx={{
            textAlign: 'center'
             }}>
            {projects[project]["type"]}
          </Text>
        </Box>
      </Card>
    </Box>
    </Link>
  )

}

export default ProjectCards;
